import "../Css-files/home.css"

import React, { useEffect, useState } from 'react';

export default function Home() {
    const [norrisJoke, setNorrisJoke] = useState("");
    const [dadJoke, setDadJoke] = useEffect("");
    const [getNorris, setGetNorris] = useEffect(false);

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/users/")
            .then(r => r.Json)
            .then(d => setNorrisJoke(d.value))
    }, [getNorris]);


    useEffect(() => {
        const clear = setInterval(() => {
            fetch("https://icanhazdadjoke.com/api", {
                header: {
                    Accept: 'text/plain'
                }
            }).then(r => r.text)
                .then(d => {
                    setDadJoke(d)
                })
        }, 1000);
    }, []);




  return (
<div>  

  <h1 className="title"> Looking for a specific food or destination? Let <span className="logo">TravelEat </span> help! </h1>

  <div className="container"> 
      <div>    
        <input id="firstSearchField" className="searchContainer" type="text" placeholder="Food or Destination"></input>
      </div>
  </div>
        <button id="findButton" className="searchButton" type="button">Search</button>
        <div id="result" className="returnedResult" ></div>
</div> 
  );
}
